import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: '<div class="col-xs-8 col-xs-offset-2">' +
    '<h2>{{ name }}</h2>' +
    '<h2>{{ name | }}</h2>' +
    '</div> '
  //styleUrls: ['./app.component.css']
})
export class AppComponent {
  name = 'WebForMyself';
  pl = Math.PI;
  money = 350;
  date = new Date();
  amount = 0.45;
  object = {
    foo: 'bar',
    buz: 'qux',
    nested: {
      xyz: 3,
      numbers: [1, 2, 3]
    }
  };
}
